object Solution {
    def minimumBeautifulSubstrings(s: String): Int = {
        if(s.head == '0') return -1

        val powersOfFive = Stream.iterate(1L)(_ * 5).takeWhile(_ <= (1L << s.length) - 1).map(_.toBinaryString).toSet
        val dp = Array.fill(s.length + 1)(Int.MaxValue)
        dp(0) = 0

        for(i <- 1 to s.length) {
            for(j <- 0 until i) {
                if(s(j) != '0' && powersOfFive.contains(s.substring(j, i))) {
                    if(dp(j) != Int.MaxValue) dp(i) = dp(i) min dp(j) + 1
                }
            }
        }

        if(dp(s.length) == Int.MaxValue) -1 else dp(s.length)
    }
}
